const initialState = {
    movies: [
        {
            id: 1,
            name: "Green Book",
            image:"",
        },
        {
            id: 2,
            name: "Venom",
            image:{image2},
        }
    ]
};

function movies(state = initialState, action) {
    switch (action.type) {
        default:
            return state;
    }
}

export default movies;
